import axios from "axios";
const axiosInstance=()=>{
    const token = localStorage.getItem("token");

    return axios.create({
        baseURL:"https://localhost:8080/",
        headers:{
            "Content-Type":"application/json",
            Authorization:"Bearer"+token,
        },
    });
};

export default axiosInstance;
